import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 32, height: 32, viewBox: "0 0 32 32", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M28.63 3.37c.5.48.5 1.28 0 1.76l-23.5 23.5a1.25 1.25 0 01-1.76-1.76l23.5-23.5a1.25 1.25 0 011.76 0z", fill: primaryFill }));
};
const Line32Filled = wrapIcon(rawSvg({}), 'Line32Filled');
export default Line32Filled;
